import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home">
      {/* Image Background */}
      <img src="/r1.jpg" alt="Health&Me background" className="background-image" />

      <div className="content">
        {/* Heading */}
        <h1>Welcome to Health&Me</h1>
        
        {/* Body Text */}
        <p>Your personal guide to food logging, exercise tracking, and more!</p>

        {/* Fitness Quote */}
        <p className="fitness-quote">
          "Take care of your body. It's the only place you have to live."
        </p>
      </div>
    </div>
  );
}

export default Home;
